import React, {Component} from  'react';

import Slider from './Slider';
import Sidebar from './Sidebar';


class Home extends Component{

	render(){
		return(
			<div id="home">
				<Slider/>

				<div className="center">
					<div id="content">
						<h1 className="subheader">Últimos artículos</h1>

						<Sidebar/>
					</div>
				</div>
			</div>
		);
	}
}


export default Home;
